// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ProductPage from './pages/product_page/product_page';
import ProductDetail from './pages/product_page/components/ProductDetail'; // Предполагается, что этот компонент еще не создан

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/products" element={<ProductPage />} />
                <Route path="/product/:id" component={ProductDetail} />
            </Routes>
        </Router>
    );
}


const Home = () => {
    return (
        <div>
            <h1>Welcome to the Home Page</h1>
            <p>This is the main page of our React application.</p>
        </div>
    );
}

export default App;
